import React from "react";
import '../styles/app.css';
import LandingPage from "./LandingPage";
import {BrowserRouter,Switch,Route} from "react-router-dom"
import Login from "./Login.js";

function App() {
  return (
    <BrowserRouter>
    <Switch>
      <Route path = "/" exact>
      <div className="App">
      <LandingPage />    
      </div>
      </Route>
      <Route path = "/auth">
      <Login/>
      </Route>
    </Switch>

    </BrowserRouter>

  );
}

export default App;
